import React from 'react';
import TaskForm from './components/TaskForm';
import TaskList from './components/TaskList';
import NotesUpload from './components/NotesUpload';

function App() {
  return (
    <div>
      <h1>Study Tracker</h1>
      <TaskForm />
      <TaskList />
      <NotesUpload />
    </div>
  );
}

export default App;
